Looking at the above script used to generate the binarized mask, we can see there are three main sections to the script. This same rough structure should be maintained for any custom recipe file created by the user. Several of the imports in the first part must be included, and the standard entry point, if __name__ == "__main__": section should not be modified by the user. The user should only modify the process_image function to achieve the desired image processing routine. More details on the various parts of the script follow below: Part 1, library imports: The top several lines contain several import statements. Here we are bringing in various libraries, either native to python or included in the pytribeam package, to perform various tasks. The first two imports are critical and must be included in the final recipe file: # python standard libraries
from pathlib import Path
import sys The remainder of the import statements can be modified by the user depending on the nature of the image processing workflow. This example uses a variety of simple tools (pillow, numpy, and scikit-image) to import, segment, and write out image data that will already be avialable in your python environment. Part 2: The image processing recipe. All of the image processing to generate the desired binarized mask is achieved through the process_image() function. The example script performs the following operations to generate the binarized mask image shown above : - Import the image using the Pillow library - Convert the image to a numpy array - Apply a simple Otsu threshold - Remove all but the largest continuous feature: - Label connected components - Find the largest continuous component - Mask the largest component, removing all others - Save out the image Users may implement their own image processing routines and bring in any other functions or packages they deem necessary or helpful to get their desired result. It is, however, imperative that the users be sure to write out the final image as a .tif file before the end of the process_image() function. Users should there plan to retain at least the following lines, or something similar, at the end of their process_image() function: # write out image
mask = pil_img.fromarray(mask)
mask.save(output_path) return True Part 3: The standard entry point. Users should not adjust the last several lines of this example, as this is required by pytribeam to correctly pass the user-defined settings of where to find the input grayscale ion image (automatically defined by the experimental directory, the step name, and the slice number) and where to save the ouput mask image (the mask_file user parameter). These lines allow the initiated subprocess from the main pytribeam acquisition loop to parse parameters correctly: if __name__ == "__main__": # Get input and output paths passed from the subprocess: input_path = Path(sys.argv[1]) output_path = Path(sys.argv[2]) # Process the image process_image( input_path=input_path, output_path=output_path, ) Users can test their script by calling the following, provided they have correctly defined the variables recipe_file, input_image_path and mask_file as strings. The following should create the mask_file image at the user-defined location: import subprocess output = subprocess.run(
[ "python", recipe_file, # recipe_file input_image_path, # input path, mask_file, # outputpath,
],
capture_output=True,
)
if output.returncode != 0:
raise ValueError( f"Subprocess call did not execute correctly."
)
